    <div >
      <video id="video" className='videoTag' autoPlay loop muted fluid>
        <source src={sample} type='video/mp4' />
      </video>
      <TypeWriterEffect
        textStyle={{
          fontFamily: 'Montserrat',
          color: 'Black',
          fontWeight: 'Bold',
          fontSize: '3em',
        }}
        startDelay={500}
        cursorColor="#3F3D56"
        multiText={[
          ' IF YOU DON\'T KNOW WHERE YOU ARE GOING, YOU WILL WIND UP SOMEWHERE ELSE. -YOGI BERRAyou will wind up somewhere else. - Yogi Berra',

        ]}
